import defaultArticles from '../fixtures'

export default (articles = defaultArticles, action) =>{

  const { type, payload, randomId } = action

  switch (type){

	case 'ADD_ARTICLE':
		  const article = articles(payload.articleId)
		  return{
			  ...articles.concat(payload.articleId) 
		  }


    default:
        return articles
  }

}
